import React, { Component } from 'react';
import {Navbar,Nav,Container,NavDropdown,Card} from 'react-bootstrap';


class AdminDashBoard extends Component {
    render() {

      logout=()=> {
    
        // let user = { username: sessionStorage.getitem("name"), password: sessionStorage.getitem("password") , role: sessionStorage.getitem("role")};
        sessionStorage.clear();
        console.log("User Session Clear");
        // window.location.href = '/Login';
        LogoutService.logout()
    
    
            .then(response => {
    
              console.log('user loggedOut successfully', response.data);
    
              this.props.history.push('/Login');
            });
    }
        return (
            <div>
                <div>
            
              <Navbar variant="dark" bg="dark" expand="lg">
  <Container fluid>
    <Navbar.Brand href="./Home">Home</Navbar.Brand>
    <Navbar.Toggle aria-controls="navbar-dark-example" />
    <Navbar.Collapse id="navbar-dark-example">
      <Nav>
        <NavDropdown
          id="nav-dropdown-dark-example"
          title="Dropdown"
          menuVariant="dark"
        >
          <NavDropdown.Item href="./AddMovie">Add Movie</NavDropdown.Item>
          
          <NavDropdown.Item href="./Movies">Show Listed Movies</NavDropdown.Item>
          <NavDropdown.Divider />
          <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
        </NavDropdown>
       
      </Nav>
      <Nav className=" text-right">
      <Nav.Link href="./Logout">SignOut</Nav.Link>

    
    </Nav>
    </Navbar.Collapse>
  </Container>
</Navbar>
</div>

</div>
            
        );
    }
}

export default AdminDashBoard;
